  11,\n\t\"tags\": [],\n\t\"title\": \"Physical, meteorological, wave spectra, and
  other data from CTD casts and current meters aboard NOAA Ship McARTHUR in the Columbia
  River (Wash./Oregon) from 1981-05-06 to 1981-11-25 (NCEI Accession 8300033)\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 2,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-10-04T01:55:11.247607\",\n\t\"name\": \"physical-meteorological-wave-spectra-and-other-data-from-ctd-casts-and-current-meters-aboard-th\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Physical, meteorological, wave spectra,
  and other data were collected from CTD casts and current meters from NOAA Ship McARTHUR
  and other platforms in the Columbia River (Wash./Oregon). Data were collected by
  the National Ocean Service (NOS) from 06 May 1981 to 25 November 1981. Data were
  processed by NODC to the NODC standard F022-High-Resolution CTD/STD Output and the
  F191-Meteorology and Wave Spectra formats. Full format and format code descriptions
  are available at http://www.nodc.noaa.gov/General/NODC-datafmts.html.nnThe F022
  format contains high-resolution data collected using CTD (conductivity-temperature-depth)
  and STD (salinity-temperature-depth) instruments. As they are lowered and raised
  in the oceans, these electronic devices provide nearly continuous profiles of temperature,
  salinity, and other parameters. Data values may be subject to averaging or filtering
  or obtained by interpolation and may be reported at depth intervals as fine as 1m.
  Cruise and instrument information, position, date, time and sampling interval are
  reported for each station. Environmental data at the time of the cast (meteorological
  and sea surface conditions) may also be reported. The data record comprises values
  of temperature, salinity or conductivity, density (computed sigma-t), and possibly
  dissolved oxygen or transmissivity at specified depth or pressure levels. Data may
  be reported at either equally or unequally spaced depth or pressure intervals. A
  text record is available for comments.nnThe F191 format is used to report meteorological
  data and ocean wave spectra data from NDBO. The format contains seven data record
  types to: 1) identify the buoy for position, duration, rate of sampling and heading,
  2) identify the meteorological parameters, (temperature, pressure, weather, solar
  radiation, and surface waves), and 3) report time times series frequency, density
  and resolution of waves. Each record is 120 character in length, sorted by station
  and record type.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
